2348678, 9663, 2, 'Официальный дилер Chevrolet, Opel, Chevrolet NIVA в Обнинске. Обмен автомобилей с пробегом на новые автомобили концерна General Motors и АвтоВаз. Сервисный центр, магазин аксессуаров и запчастей, кузовная станция.Автоцентр “Рантект Моторс” был создан в 2007 году и за время своего существования приобрел репутацию стабильной и надёжной компании, превыше всего ставящей высокое качество обслуживания клиентов.Мы предлагаем вам полный спектр услуг по продаже и обслуживанию автомобилей Chevrolet, Opel и Chevrolet NIVA.Мы стараемся сделать так, чтобы посещение нашего автосалона было для наших клиентов максимально удобным и приятным. Для этого мы создаём оптимальные условия на всех этапах приобретения и послепродажного обслуживания автомобилей.Автоцентр “Рантект Моторс” представляет широкий модельный ряд автомобилей концерна “General Motors": Chevrolet Spark, Chevrolet Aveo, Chevrolet Cruze, Chevrolet Lacetti, Chevrolet Epica, Chevrolet Captiva, российский внедорожник Chevrolet Niva. а также полную линейку автомобилей Opel.Квалифицированные продавцы внимательно выслушают ваши пожелания и помогут выбрать автомобиль, оптимально удовлетворяющий ваши потребности и желания. В автосалоне “Рантект Моторс” вы сумеете получить полный спектр услуг, сопровождающих покупку автомобиля,  кредитование или страхование.Также мы рады предложить вам гарантийное обслуживание и ремонт автомобилей в нашем сервисном центре, условия которого полностью соответствуют высоким стандартам компании General Motors. Наша команда состоит из профессионалов, хорошо знающих своё дело и обладающих уникальным опытом продажи и обслуживания автомобилей. Мы тщательно обучаем персонал компании. Каждый из сотрудников “Рантект Моторс” прошёл профессиональное обучение в центрах подготовки дистрибьютора.Всегда в наличии широкий выбор оригинальных запасных частей, обладающих высоким качеством, которое рассчитывают получить наши покупатели.'
