365, 45983, 264, 283, 1, 0, 30, '3er', '3 серия', '3er', 'Дизайн автомобилей BMW 3ER сочетает в себе главную идею марки — элегантность и агрессию. И не зря один из лозунгов компании– «Автомобиль для водителя», как нельзя лучше отражает суть БМВ 3ER. Вам необходимо продать свой автомобиль BMW 3ER быстро и выгодно? Автопортал AUTO.RU охотно поможет вам в этом. Подать объявление по продаже автомобилей BMW 3ER можно удобно и быстро, а благодаря высокой посещаемости нашего сайта ваш автомобиль удастся реализовать в кратчайшие сроки. Желающим купить БМВ 3ER в Москве или других городах России, сайт AUTO.RU предлагает широчайший выбор автомобилей, среди многообразия которых вы несомненно найдете наиболее подходящий вариант.', 0, 0, 'group', 122, '3ER', 365, null, null
383, 365, 281, 282, 2, 0, 30, 'V (E90/E91/E92/E93)', '5 (Е90/Е91/Е92/Е93)', 'v', '', 0, 0, 'model', 19040, '2305536', 383, 'FAMILY', 'PREMIUM'
