24797, 45969, 232, 237, 1, 0, 15, 'Q5', 'Q5', 'q5', 'Автомобиль Audi Q5 получил прозвище самого спортивного и динамичного кроссовера из всех тех, что имеются в данном классе. Его комфортно использовать за городом и в границах мегаполиса. Плавное переключение скоростей, идеальная шумоизоляция и новейшие системы безопасности – это далеко не все, чем может похвастаться Ауди Q5.  Данная модель Audi дебютировала в Пекине в 2008 году, а производство его было налажено в Германии, Китае и Индии. Премьера была настолько удачной, что Q5 переманила на свою сторону любителей других классов авто конкурентных компаний. В сравнении с Ауди Q7 модель Q5 выделялась меньшими размерами и большей экономичностью.', 0, 0, 'group', 19940, 'Q5', 24797, null, null
50580, 24797, 235, 236, 2, 0, 15, 'I', '1', 'i', '', 0, 0, null, null, '3784280', 50580, 'FAMILY', 'PREMIUM'
46119, 1, 1, 460, 0, 0, 170, '', '', '', '', 0, 0, null, null, null, null, null, null
4452, 46119, 280, 287, 1, 0, 170, 'GL-klasse', 'GL-класс', 'gl-klasse', 'Начиная с 2006 года, компания выпускает на рынок новую звезду класса SUV или Mercedes-Benz GL-klasse. Просторность и комфорт органично сочетается с высокой динамикой модели, в результате чего получается роскошный кроссовер. Мерседес-Бенц GL-класса не только исключительно устроен внутри, но и имеет импозантный экстерьер.  Более важно другое: впервые автомобили такого класса оснащаются системой безопасности PRE-SAFE. В дополнение к этому Mercedes-Benz GL-klasse комплектуется системами стабилизации при боковом ветре и помощи водителю в управлении рулем, а также Collision Prevention Assist – разработкой, препятствующей аварии. В списке полезных бонусов Мерседес Бенц GL-класса – система контроля за «мертвыми» зонами.', 0, 0, 'group', 1647, 'GL_KLASSE', 4452, null, null
