INSERT INTO catalog7_yandex.marks VALUES(?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?)
205, 'Peugeot', 'Пежо', 'peugeot', 'В настоящее время компания занимает второе место в Европе по объемам производства автомобилей. Основным преимуществом, которое привлекает множество клиентов, является невысокая стоимость Peugeot. Руководство компании уделяет много внимания выпуску машин компакт и среднего класса.  Именно цена на Пежо – одна из главных составляющих успеха компании. Стоит отметить, что изначально концерн специализировался далеко не на производстве автомобилей. Она выпускала кольца «панье» для женских платьев, затем кольца для зонтиков. Первым транспортным средством, выпущенным на предприятии, был велосипед.   Если сравнить, сколько стоит Peugeot и его «одноклассники» от других производителей, то можно заметить, что в этом вопросе машины этой марки имеют заметное преимущество. Что касается надежности, то здесь автомобиль Пежо отрабатывает свои деньги на все сто процентов.', 1, 1, 0, 10, 'PEUGEOT', 205
109, 'Hyundai', 'Хёндэ', 'hyundai', 'Автомобили марки Hyundai насчитывают уже несколько десятков моделей, произведенных всего за несколько десятилетий. Легковые автомобили Хендэ покрывают широкий спрос мирового потребителя. Объявления о продаже Hyundai сегодня встречаются все чаще, причиной тому служит непрерывный рост доли этих автомобилей на отечественном рынке. Цены автомобилей Хендэ находятся на уровне, доступном широкому кругу потребителей, что вкупе с высоким качеством и обуславливает его популярность во всем мире.', 1, 1, 0, 30, 'HYUNDAI', 109
30, 'BMW', 'БМВ', 'bmw', 'Легковые автомобили BMW имеют богатую историю и не менее перспективное будущее. Яркий пример баварских моторных заводов, аббревиатуру которых и носит марка БМВ, – легковые авто, характеризующиеся одними из лучших технических характеристик в мире. Производитель уже на протяжении столетия производит авто под лозунгом «с удовольствием за рулем». Купить BMW можно по всему миру. Производитель предлагает оптимальное соотношение цены и немецкого качества. Узнать цены на БМВ в российском регионе можно из объявлений на нашем сайте.', 1, 1, 0, 6, 'BMW', 30
15, 'Audi', 'Ауди', 'audi', 'Автомобили марки Audi – это символ немецкого непревзойденного качества, представленный в широком модельном ряде. На сегодняшний день автомобильная марка Ауди насчитывает порядка десяти моделей. В ближайшее время этот ряд различных типов авто пополнится ещё семью моделями. Купить Audi – значит сделать правильный выбор в сторону качества и лучших традиций немецкого автопроизводства. Постоянный рост оборотов позволяет этой марке выпускать различные типы авто с отличными характеристиками техники и дизайна.', 1, 1, 0, 6, 'AUDI', 15
170, 'Mercedes-Benz', 'Мерседес-Бенц', 'mercedes', 'История этой марки насчитывает более 100 лет. Еще в 1886 году Карлом Бенцем была выпущена первая в мире тележка на трех колесах, оснащенная бензиновым двигателем. Сегодня любой автомобилист желает купить Mercedes-Benz.  Все без исключения автомобили Мерседес-Бенц, независимо от класса, к которому они относятся, отличаются  высоким качеством исполнения и надежностью в процессе эксплуатации. Практически в каждом классе компания имеет флагмана, являющегося примером для других производителей.', 1, 1, 0, 6, 'MERCEDES', 170
166, 'Mazda', 'Мазда', 'mazda', 'Легковые автомобили Mazda пользуются большой популярностью среди автолюбителей по всему миру. Продукция этого производителя отличается хорошим соотношением цены с качеством, функциональностью и комфортностью в процессе эксплуатации. Относительно невысокая цена на Мазда позволяет ей успешно конкурировать с машинами, выпускаемыми другими автомобильными концернами. Сегодня выпускаются автомобили Mazda различных классов, благодаря чему любой автолюбитель сможет найти для себя оптимальную модель.', 1, 1, 0, 31, 'MAZDA', 166
273, 'Volkswagen', 'Фольксваген', 'volkswagen', 'Volkswagen – известная немецкая автомобильная марка, начало которой положил сам Фердинанд Порше. Название Фольксваген переводится с немецкого, как "народный автомобиль", функциональный, практичный и доступный каждому.  Легковые автомобили Volkswagen постоянно совершенствуются, разработчики стремятся улучшить все возможные характеристики и создать идеальную модель. Покупка Фольксваген – это покупка автомобиля с одним из лучших соотношений цены и качества. Например, стоимость Volkswagen Jetta (элегантный комфортный седан) составляет всего около 750 000 рублей.', 1, 1, 0, 6, 'VOLKSWAGEN', 273
260, 'Toyota', 'Тойота', 'toyota', 'Toyota – самая крупная автомобилестроительная корпорация Японии. Компания производит легковые и грузовые автомобили, а также автобусы. Бренды Toyota, Lexus, Hino, Daihatsu, Scion – все они являются детищем этой корпорации.   В мае 2012 года мировая продажа Тойота превысила все ожидания и компания вырвалась на первое место по производству автомобилей, обогнав General Motors и Volkswagen. Купить Тойота – значит отдать предпочтение японскому качеству и надежности. Объявления Yaris, Corolla, Camry, RAV4 или Land Cruiser Prado являются одними из самых запрашиваемых на автомобильном рынке России.', 1, 1, 0, 31, 'TOYOTA', 260
147, 'Land Rover', 'Ленд Ровер', 'land-rover', 'Автомобили Land Rover стоят отдельным рядом в общей картине мирового автомобилестроения. Эта британская марка носит узкую специализацию: Ленд Ровер авто повышенной проходимости класса «премиум». Одним из первых заводов, производивших авто этой марки стал завод, выпускавший двигатели для танков и самолетов. На его мощностях и началась история производства Land Rover, надежность которого поражает до сих пор. И несмотря на то что модельный ряд представлен всего шестью моделями, эта марка пользуется популярностью среди авто профессионалов и любителей по всему миру. Стоимость  Ленд Ровер полностью соответствует его великолепным характеристикам.', 1, 1, 0, 28, 'LAND_ROVER', 147
181, 'Mitsubishi', 'Митсубиси', 'mitsubishi', 'Изначально компания специализировалась на производстве судов. Но со временем  она наладила выпуск грузовых авто, которые пользовались довольно большой популярностью. Следующим этапом стали легковые автомобили Mitsubishi.  Сегодня покупка Митсубиси – желанная процедура для многих автолюбителей. Авто этой марки пользуются большой популярностью из-за относительно невысокой стоимости, сочетающейся с качеством и высокой степенью комфорта эксплуатации машин.    Объявления о продаже Mitsubishi сегодня можно встретить в любом специализированном издании, что лишний раз говорит о высокой популярности авто данного производителя.', 1, 1, 0, 31, 'MITSUBISHI', 181
--
