1043270830, '6b56a', '2016-08-21 14:36:59', '2016-08-30 10:25:07', '2016-10-20 14:37:02', 18318774, 1039076492, 1, 87, 1123, 225, 1, 213, null, null, null, 1, 15, 109, 30907, 58238, 2011, 875000.0, 875000.0, 'RUR', 'Автомобиль с трассовым пробегом, не пробки. Не курили. Пройдены все ТО (последнее 135 тыс. км.). Сервисная книжка. Есть фаркоп. Состояние прекрасное. Один владелец. Без ДТП. Зимняя резина в отличном состоянии.', 1, 1, 0, null, null, null, null, null, null, null, 0, null
1043140898, '81de', '2016-08-17 05:09:08', '2016-08-27 05:14:02', '2016-08-27 20:46:16', 10816570, 0, 1, 21, 1286, 0, 0, 0, 15032, 15144, 1828094, 1, 15, 30, 383, 81638, 2007, 680000.0, 680000.0, 'RUR', 'Автомобиль в очень хорошем состоянии.  Полный привод. По ПТС 3 владельца. Салон не затерт, не прокурен.  Проведена комплексная диагностика. Серьезных нареканий не выявлено. Максимальная комплектация .Продажа от официального дилера Chevrolet. Этот автомобиль Вы можете приобрести в кредит без КАСКО с выгодной процентной ставкой, а так же использовать свой автомобиль в качестве первоначального взноса или обменять свой автомобиль по программе Trade-In.Рантект Моторс - официальный дилер Chevrolet.Осмотр г.Обнинск, 80 км от МКАД по Киевскому шоссе.Подробная информация по телефону.[gabhedi:63974]', 7, 1, 0, null, null, null, null, null, 10600, 9663, 13024901, null
1042409964, '038a', '2016-08-01 04:48:07', '2016-08-09 13:42:51', '2016-08-14 14:09:06', 10718386, 0, 1, 87, 1123, 0, 0, 0, 14910, 15022, 1744970, 1, 15, 15, 50580, 53098, 2011, 1015000.0, 1015000.0, 'RUR', 'Оригинал ПТС, 2 собственника, ухоженный, не прокуренный салон. В комплектации электропривод сидений и крышки багажника, вентиляция сидений, парктроники передние и задние, камера заднего вида с динамической разметкой. Коробка работает идеально, была пол года назад обновлена по гарантии.[gaifaoh:99558]', 0, 1, 0, null, null, null, null, null, 10086, 9542, 0, null
1043045004, '977b3', '2016-08-14 18:33:14', '2016-09-01 07:01:31', '2116-10-20 17:55:15', 10591660, 1038151348, 1, 87, 1123, 225, 1, 213, null, null, null, 1, 15, 170, 53253, 98876, 2011, 1850000.0, 1850000.0, 'RUR', 'GL350 CDI 4 matic, комплектация Grand Edition, AMG Пакет. Бережный уход. Пробег реальный не смотанный (70-80 тыс км за 4,5 года это сомнительно). Куплен у официала МБ на Ленинградском ш. в декабре 2011, эксплуатация с января 2012 года. 3-года на гарантии потом обслуживался в МБ Лукойл-Центрнефтепродукт на Новорижском ш. Всю историю обслуживания предоставлю. Салон кожа чёрная с бежевыми вставками с белой строчкой. Потолок черный. Все в отличном состоянии. История без аварий и замен деталей.  Торг у капота.', 1, 1, 0, null, null, null, null, null, null, null, 0, null
1044216699, '0f1a0', '2016-09-23 03:40:45', '2016-09-23 03:40:45', '2016-11-22 03:40:45', 18740415, 1041499733, 1, 38, 4746, 225, 1, 21642, null, null, null, 1, 15, 166, 2101, 83454, 1999, 89000.0, 89000.0, 'RUR', 'Машина в хорошем состояние для своих лет по кузову требует внимание пороги начинают... и крышка багажника в остальном все ок', 8, 1, 0, null, null, null, null, null, null, null, 0, null
1037186558, 'e06d8', '2016-05-13 04:16:54', '2016-07-28 13:52:30', '2016-06-29 08:47:13', 16189485, null, 1, 87, 1123, 0, 0, 0, 20433, 20533, 1354420, 1, 15, 273, 53097, 88120, 2011, 1650000.0, 1650000.0, 'RUR', 'Срочно!, дизель 180 сил,  ПОЛНЫЙ ПРИВОД! комплектация ХАЙЛАЙН  Электро-сдвижные двери с двух сторон, салон алькантара, столик, шторки на всех окнах, ДВД для детей, монитор НАВИ, ДВД, камера заднего вида, датчики помех в зеркалах , вебасто и т д, есть все!  Машинка в идеальном состоянии, один собственник после Германии в 2014г, ПРОБЕГ РОДНОЙ, есть вся история от дилера. Ни каких аварий, родная краска.  ПТС оригинал, все ключи + брелок вебасто.  Возможен обмен.  Условия обмена читайте ниже..В нашем Клубном Автосалоне &quot.Вешки&quot. продаются машины, выкупленные у хозяев, в основном проживающих в поселке &quot.Новые Вешки&quot. и рядом, это машины людей, понимающих толк в хороших авто и содержащих эти машины в достойном состоянии.. Есть разные машины, мощные и не очень, красивые и так-себе, а так-же  другие авто, принятые по обмену.. Это своеобразный клуб любителей меняться машинами, ну или просто часто менять &quot.железных коней&quot... Все машины мы стараемся оценивать по самым нижним ценам рынка, чтоб они продавались быстро, за 3-5 дней максимум. На этих-же условиях при обмене оцениваются авто, которые Вы возможно захотите предложить в зачет, ( Трейд-Ин).ДЛЯ ПРОСМОТРА ВСЕХ ПРЕДЛОЖЕНИЙ О ПРОДАЖЕ АВТОМОБИЛЕЙ НАЖМИТЕ НАЗВАНИЕ &quot.АВТОСАЛОН&quot..Машины проверены по всем известным базам, включая автокод, НБКИ, реестр залогов, база судебных решений, а так-же наличию не погашенных штрафов ГИБДД. Приобретая машину у нас, Вы получаете самую привлекательную цену по рынку, без различных скрытых платежей, без всяческих предварительных договоров купли-продажи и других различных ухищрений, так любимых во многих автосалонах Москвы.- Перед выездом обязательно свяжитесь с нами и уточните наличие! Машины быстро продаются!', 7, 1, 0, null, null, null, null, null, 21029, 15313, 13043497, null
